class QuestionGenerator:
    def __init__(self, entity, subgraph, n):
        self.entity = entity
        self.subgraph = subgraph
        self.n = n

    def questions(self):
        questions = []
        for triple in self.subgraph:
            question = triple[0]
            for prop in triple[1:]:
                question += f" {prop}"
            questions.append(question)
        return questions[:self.n]

    def dialogue(self):
        dialogue = []
        for question in self.questions():
            dialogue.append(question)
            dialogue.append(f"The name of {self.entity} is {self.entity}.")
        return dialogue

    def sparql(self):
        sparql = []
        for question in self.questions():
            sparql.append(f"SELECT?{question} WHERE {question} {self.entity}")
        return sparql


def generate_questions(entity, subgraph, n):
    qg = QuestionGenerator(entity, subgraph, n)
